// \u901A\u8FC7\u63D2\u4EF6\u5BF9\u7BAD\u5934\u51FD\u6570\u8FDB\u884C\u8F6C\u6362
const targetSource = core.transform(sourceCode, {
  // \u89E3\u6790\u63D2\u4EF6\u5207\u6362\u5FAE Typescript,\u8FD9\u6837\u624D\u80FD\u8BC6\u522B ts \u8BED\u6CD5
  parserOpts: {
    plugins: ['typescript'],
  },
  //\u4F7F\u7528\u63D2\u4EF6
  plugins: [tsLintPlugin],
  filename: 'main.js',
});
