      const itemMetaData = measuredDataMap[index];
      itemMetaData.height = size.height;
      let offset = 0;
      for (let i = 0; i <= LastMeasuredItemIndex; i++) {
        const itemMetaData = measuredDataMap[i];
        itemMetaData.offset = offset;
        offset += itemMetaData.height;
      }
