export function phoneFormat(value: string): string {
  return String(value)
    .slice(0, 11)
    .replace(/(?<=\\d{3})\\d+/, ($0) => '-' + $0)
    .replace(/(?<=[\\d-]{8})\\d{1,4}/, ($0) => '-' + $0);
}

